import "./city.css";
const City = () => {
  const cityList = [
    {
      name: "Dublin",
      subText: "123 properties",
      image: "./images/city_1.webp",
    },
    {
      name: "Reno",
      subText: "533 properties",
      image: "./images/city_2.webp",
    },
    {
      name: "Austin",
      subText: "532 properties",
      image: "./images/city_3.webp",
    },
  ];
  return (
    <div className="row">
      {cityList.map((city, index) => {
        return (
          <div className="col-4 rounded-1" key={index}>
            <img src={city.image} alt="#" width="100%" />
          </div>
        );
      })}
    </div>
  );
};
export default City;
